import './Editor.css'

function Toolbar () {
    return (
        <>
        <div className='Toolbar'>

        </div>
        </>
    )
}

function Editor () {
    return (
        <>
        <div>
            <Toolbar />
        </div>
        </>
    )
}


export default function Page () {
    return (
      <>
        <div>
          <Editor />
        </div>
      </>
    );
  }
